int getDayOfMonth(long millis, int year, int month) {
long dateMillis = getYearMillis(year);
dateMillis += getTotalMillisByYearMonth(year, month);
return (int) ((millis - dateMillis) / DateTimeConstants.MILLIS_PER_DAY) + 1;
}

